text:
Chi dice che destra e sinistra non esistono più, che è tutto un miscuglio, sbaglia. 
Destra e sinistra esistono ancora: le destre hanno messo da parte la lotta al cambiamento climatico. Noi abbiamo scelto il futuro, sapendo che non c'è più tempo a disposizione.

